import './Menu.css'

function Menu() {

  return (
    <div id='menu'>

      <header>Table of Contents</header>
      <ul>
        <li>Introduction</li>
        <li>About</li>
        <li>Experience</li>
        <li>Portfolio</li>
        <li>Contact</li>
      </ul>
    </div>
  )
}

export default Menu;
